(function() {
                                const edgeStr = 'Microsoft Edge';
                                const chromeStr = 'Google Chrome';
                                const chromiumStr = 'Chromium';

                                const getProp = Object.getOwnPropertyDescriptor;
                                const setProp = Object.defineProperty;
                                const navigatorProto = Navigator.prototype;
                                const uaDataProto = NavigatorUAData.prototype;

                                const orig_vendor = getProp(navigatorProto, "vendor");
                                const orig_vendorSub = getProp(navigatorProto, "vendorSub");
                                const orig_appVersion = getProp(navigatorProto, "appVersion");

                                const orig_userAgent = getProp(navigatorProto, "userAgent");
                                const getOrigUserAgent = orig_userAgent.get.bind(navigator);

                                const orig_brands = getProp(uaDataProto, "brands");
                                const getOrigBrands = orig_brands.get.bind(navigator.userAgentData);

                                const orig_getHighEntropyValues = getProp(uaDataProto, "getHighEntropyValues");
                                const getOrigHighEntropyValues = orig_getHighEntropyValues.value.bind(navigator.userAgentData);

                                const hideMinorVersion = function() {
                                    return ( +(/Chrome\/([0-9]+)/.exec(getOrigUserAgent()) || [,'99'])[1] >= 104 );
                                };

                                const getChromiumVerFromBrands = function(arr) {
                                    const chromiumIdx = arr.findIndex(v => v.brand == chromiumStr);
                                    return arr[chromiumIdx].version;
                                };

                                const replaceBrands = function(arr) {
                                    const chromiumVer = getChromiumVerFromBrands(arr);
                                    const majorVer = +(chromiumVer.split(".")[0]);
                                    return arr.map(entry => {
                                        const brand = (entry.brand == edgeStr) ? chromeStr   : entry.brand;
                                        let version = (entry.brand == edgeStr) ? chromiumVer : entry.version;
                                        return { brand: brand, version: version };
                                    });
                                };

                                const replaceBrandInStr = function(str) {
                                    return str.replace(edgeStr, chromeStr);
                                };

                                const replaceUserAgent = function(str) {
                                    const noEdg = str.replace(/[\s]+Edg[^\s]+/, '');
                                    if (!hideMinorVersion())
                                        return noEdg;
                                    return noEdg.replace(/Chrome\/([0-9]+)\.[0-9]+\.[0-9]+\.[0-9]+/, "Chrome/$1.0.0.0");
                                };

                                const getNewUserAgent = function userAgent() { return replaceUserAgent(getOrigUserAgent()); };
                                const getNewVersion = function appVersion() { return getNewUserAgent().replace('Mozilla/', ''); };
                                const getNewBrands = function brands() { return replaceBrands(getOrigBrands()); };

                                const getNewHighEntropyValues = function getHighEntropyValues(params) {
                                    let origParams = params;
                                    if (typeof params == "string")
                                        params = [params];
                                    let noFullVersionList = true;
                                    try {
                                        Array.from(params).forEach(function(s) {
                                            if (s == "uaFullVersion") {
                                                [].push.call(params, "fullVersionList");
                                            } else if (s == "fullVersionList") {
                                                noFullVersionList = false;
                                            }
                                        });
                                    } catch (e) {}
                                    return getOrigHighEntropyValues(params).then(function(result) {
                                        if (result.fullVersionList) {
                                            const chromiumVer = getChromiumVerFromBrands(result.fullVersionList);
                                            if (result.uaFullVersion)
                                                result.uaFullVersion = chromiumVer;
                                            result.fullVersionList = replaceBrands(result.fullVersionList);
                                        }
                                        if (noFullVersionList)
                                            delete result.fullVersionList;
                                        result.brands = replaceBrands(result.brands);
                                        return result;
                                    });
                                };

                                if (orig_getHighEntropyValues.value !== getNewHighEntropyValues) {
                                    const objProto = Object.prototype;
                                    const funProto = Function.prototype;

                                    const obj_toString = objProto.toString;
                                    const obj_valueOf = objProto.valueOf;

                                    const fun_toString = funProto.toString;
                                    const fun_valueOf = funProto.valueOf;

                                    const changedFunctions = [];

                                    const check = function(f) {
                                        let result = false;
                                        changedFunctions.forEach(function(func) {
                                            if (f === func)
                                                result = true;
                                        });
                                        return result;
                                    };

                                    const checkAndReturn = function(orig, self, args) {
                                        try {
                                            if (check(self)) {
                                                return 'function ' + self.name + '() { [native code] }';
                                            }
                                        } catch (e) {}
                                        return orig.apply(self, args);
                                    };

                                    const new_obj_toString = function toString(dumb) {
                                        return checkAndReturn(obj_toString, this, arguments);
                                    };
                                    changedFunctions.push(new_obj_toString);

                                    const new_fun_toString = function toString(dumb) {
                                        return checkAndReturn(fun_toString, this, arguments);
                                    };
                                    changedFunctions.push(new_fun_toString);

                                    const new_obj_valueOf = function valueOf(dumb) {
                                        return checkAndReturn(obj_valueOf, this, arguments);
                                    };
                                    changedFunctions.push(new_obj_valueOf);

                                    const new_fun_valueOf = function valueOf(dumb) {
                                        return checkAndReturn(fun_valueOf, this, arguments);
                                    };
                                    changedFunctions.push(new_fun_valueOf);

                                    objProto.toString = new_obj_toString;
                                    objProto.valueOf = new_obj_valueOf;
                                    funProto.toString = new_fun_toString;
                                    funProto.valueOf = new_fun_valueOf;

                                    const addChangedFunctions = function(funcs) {
                                        if (!funcs)
                                            return;
                                        if (!Array.isArray(funcs))
                                            funcs = [funcs];
                                        funcs.forEach(function(func) { changedFunctions.push(func); });
                                    };

                                    const addGetPrefix = function(f) {
                                        const name = f.name;
                                        setProp(f, "name", {
                                            value: 'get ' + name, 
                                            writable: false,
                                            enumerable: false,
                                            configurable: true,
                                        });
                                    };

                                    const get_vendor = function vendor() { return 'Google Inc.'; };

                                    addChangedFunctions(get_vendor);
                                    addGetPrefix(get_vendor);
                                    if (navigator.vendor != 'Google Inc.')
                                        setProp(navigatorProto, 'vendor', 
                                            Object.assign({}, orig_vendor, {get: get_vendor}));

                                    const get_vendorSub = function vendorSub() { return ''; };
                                    addChangedFunctions(get_vendorSub);
                                    addGetPrefix(get_vendorSub);
                                    if (navigator.vendorSub !== '')
                                        setProp(navigatorProto, 'vendorSub', 
                                            Object.assign({}, orig_vendorSub, {get: get_vendorSub}));

                                    addChangedFunctions(getNewVersion);
                                    addGetPrefix(getNewVersion);
                                    setProp(navigatorProto, 'appVersion', 
                                        Object.assign({}, orig_appVersion, {get: getNewVersion}));

                                    addChangedFunctions(getNewUserAgent);
                                    addGetPrefix(getNewUserAgent);
                                    setProp(navigatorProto, 'userAgent', 
                                        Object.assign({}, orig_userAgent, {get: getNewUserAgent}));

                                    if (navigator.userAgentData) {
                                        addChangedFunctions(getNewBrands);
                                        addGetPrefix(getNewBrands);
                                        setProp(uaDataProto, "brands", 
                                            Object.assign({}, orig_brands, {get: getNewBrands}));

                                        addChangedFunctions(getNewHighEntropyValues);
                                        setProp(uaDataProto, "getHighEntropyValues", 
                                            Object.assign({}, orig_getHighEntropyValues, {value: getNewHighEntropyValues}));
                                    }
                                }

                                const script = document.currentScript;
                                if (script && script.parentNode && script.parentNode.removeChild)
                                    script.parentNode.removeChild(script);
                            })()
